class BookStoreService {
  getBook() {
    return [
      { id: 1, title: "The Stationery Shop", author: " Marjan Kamali " },
      {
        id: 2,
        title: "The Bookshop",
        author: "Penelope Fitzgerald and David Nicholls"
      }
    ];
  }
}

export default BookStoreService;
